import './App.css';
import React from 'react';
import NavbarComp from './components/NavbarComp';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './components/Home';
import Minter from './Minter'


const App = () => {
  return (
    <>
      <Router>
        <NavbarComp />
        <Switch>
          {/* <Route path="/about">
                        <About />
                    </Route>
                    <Route path="/contact">
                        <Contact />
                    </Route> */}
          <Route path="/">
            <Home />
            <Minter />
          </Route>
        </Switch>
      </Router>

    </>
  );
}

export default App;
